    max_value = max(map(key, items))
    count = [0] * (max_value + 1)
    for item in items:
        count[key(item)] += 1
    count = list(accumulate(count, initial=0))
    ret = [None] * len(items)
    for item in items:
        i = count[key(item)]
        ret[i] = item

