def quickselect(seq: Sequence[T], k: int) -> T:
    """Find the kth smallest item in a sequence."""
    low, pivot, high = partition(seq)
    low_len = len(low)
    if low_len == k:
        return pivot
    elif low_len < k:
        return quickselect(high, k - low_len - 1)
    else:
        return quickselect(low, k)

